    return ((r.getYear()<1000)?(r.getYear()+1900):r.getYear()) + "-" +
        ((r.getMonth()+1)<10?"0":"") + (r.getMonth()+1) + "-" +
        (r.getDate()<10?"0":"") + r.getDate() + " " +
        (r.getHours()<10?"0":"") + r.getHours() + ":" +
        (r.getMinutes()<10?"0":"") + r.getMinutes() + ":" +
        (r.getSeconds()<10?"0":"") + r.getSeconds();
} else {
    return r;
